# ----------------- Feature Extraction Function -----------------
def extract_window_features(window):
    """
    Compute engineered features for a given window of multivariate signals.

    This feature engineering utility designed to convert a window of raw physiological signals (like ECG, GSR, etc.)
    into a fixed-length feature vector for machine learning.

    The window is a 2D NumPy array of shape (N_samples, N_channels) covering a fixed time segment.
    Features extracted per channel:
      - mean
      - standard deviation (std)
      - root mean square (RMS)
      - peak-to-peak amplitude (max - min)
      - zero-crossing count (number of times the signal crosses zero)

    Input:A 2D NumPy array of shape (N_samples, N_channels), where:
    N_samples = number of time samples in the window (e.g., 1000 for a 10-second window at 100Hz)
    N_channels = number of signal types (e.g., 4 channels: ECG, GSR, Resp, EMG)

    Output:
    Returns a 1D NumPy array of features [feat_ch1, feat_ch2, ..., feat_chN] concatenated for all channels.
    """
    features = []
    # Compute features for each channel in this window
    for ch in range(window.shape[1]):
        sig = window[:, ch]
        mean_val = np.mean(sig)
        std_val = np.std(sig)
        rms_val = np.sqrt(np.mean(sig**2))
        ptp_val = np.max(sig) - np.min(sig)
        # Zero-crossing count: count sign changes between consecutive samples
        # We'll count a zero-crossing when the signal changes sign (excluding transitions involving exact zero values).
        # If the signal is always positive or always negative in the window, this will be zero.
        zc_count = np.sum((sig[:-1] * sig[1:]) < 0)
        features.extend([mean_val, std_val, rms_val, ptp_val, zc_count])
    return np.array(features, dtype=float)

