# ----------------- Data Loading and Preprocessing -----------------
def process_record(record_path, window_size_sec, label_map=None):
    """
    Load a single WFDB record (given the path to the .hea or base name of the record),
    segment it into fixed-length windows, compute features for each window, and assign labels.
    - record_path: path to the record (without extension or with .hea extension).
    - window_size_sec: length of each window in seconds.
    - label_map: optional mapping or function to retrieve stress label for a given time or record.
                 This could be a dictionary mapping record_id -> stress_label (for whole-record labels)
                 or a custom structure for window-level labels (e.g., intervals of stress).
                 If None, this function will assign a dummy label (for demonstration purposes).
    Returns: tuple (features_array, labels_array) for all windows in this record.
    """
    # Read the WFDB record using wfdb. This yields a Record object with p_signal (physical signals).
    # We use smooth_frames=True (default) to get a uniform sampling for multi-frequency signals (averaging high-frequency signals per frame).



    record = wfdb.rdrecord(record_path, smooth_frames=True)

    # Filter by expected number of channels
    if record.n_sig > 7:
     print(f"Warning: {record_path} has more than 7 channels: {record.n_sig}")


    data = record.p_signal  # shape: (n_samples, n_channels)
    channel_names = record.sig_name
    fs = record.fs
    n_channels = record.n_sig
    n_samples = record.sig_len


    # Calculate number of samples per window
    window_length = int(window_size_sec * fs)
    if window_length <= 0:
        raise ValueError("Window length must be positive.")

    # Determine how many full windows fit in the record
    total_windows = n_samples // window_length  # using integer division (drop any partial window at the end)
    if total_windows == 0:
        return None, None  # If the record is shorter than one window, skip it

    features_list = []
    labels_list = []
    # Loop over windowed segments
    for w in range(total_windows):
        start = w * window_length
        end = start + window_length
        segment = data[start:end, :]  # shape (window_length, n_channels)
        # Compute features for this window
        feat_vector = extract_window_features(segment)
        features_list.append(feat_vector)
        # Determine the label for this window
        if label_map is not None:
            # If a label mapping or function is provided:
            # If label_map is a dict mapping record -> label, use that (all windows same label).
            # If it's a function or other structure, determine label based on record ID and time.
            record_id = os.path.basename(record_path)
            record_id = record_id.split(".")[0]  # drop extension if present
            if callable(label_map):
                # label_map is a function that returns label for given record and time interval
                label = label_map(record_id, start, end)
            elif isinstance(label_map, dict):
                # If labels are provided per record (session-level label)
                label = label_map.get(record_id, None)
                if label is None:
                    raise KeyError(f"No label found for record {record_id} in label_map.")
            else:
                # If label_map is some other structure (e.g., list of intervals),
                # you would handle it here (not implemented in this baseline).
                label = None
        else:
            # No label info provided: assign a dummy label for demonstration.
            # Here we randomly assign 0 or 1 to each window to simulate binary labels.
            label = random.choice([0, 1])
        labels_list.append(label)
    # Convert lists to arrays
    features_arr = np.vstack(features_list)  # shape: (total_windows, features_dim)
    labels_arr = np.array(labels_list, dtype=int)
    return features_arr, labels_arr

